import { useReducer } from "react";

const WebForm = ({fields}) => {
    const [webFields, setWebFields] = useReducer((state, action) => {
        switch(action.type) {

            default:
                return state;
        }
    }, fields)


return (
    <>
        <WebFormSelect webFields={webFields}/>
    </>
)
}

export default WebForm;
